// Home.js

import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // You can create this CSS file for styling

function Home() {
  return (
    <div className="home-container">
      {/* <img src="assets/Student.jpg" alt="Background" className="background-image" /> */}

      <div className="content">
        <h1 className="title">Welcome to Student-Teacher Portal</h1>
        <div className="button-container">
          <Link to="/student" className="student-button">Student</Link>
          {/* Add a gap between Student and Teacher buttons */}
          <div className="button-gap"></div>
          <Link to="/teacher" className="teacher-button">Teacher</Link>
        </div>
      </div>
    </div>
  );
}

export default Home;
